  --ss-ms-r: 1.5rem;
  --ss-ms-l: 3rem;
  --ss-ms-xl: 9rem;
  /* padding spacing  */
  --ss-ps-l: 1.5rem;
  --ss-ps-r: 1rem;
  --ss-ps-s: 0.5rem;
  /* tab  */
  /* margin spacing  */
  --ss-ms-xl-t: 6rem;
  --ss-ms-l-t: 2.5rem;
  /* phone  */
  /* margin spacing  */
  --ss-ms-xl-p: 4rem;
  --ss-ms-l-p: 2rem;
  --ss-ms-r-p: 1.25rem;
  /* padding spacing  */
  --ss-ps-l-p: 1.25rem;
}

/* Utility class */
.container {
  padding: var(--ss-global-container);
}
.section-spacing {
  margin-top: var(--ss-ms-xl);
  margin-bottom: var(--ss-ms-xl);
}
.primary-gradient {
  background: linear-gradient(180deg, #717342 0%, #717342 43.5%, #959855 100%);
}

/* PC typography  */
.display {
  font-family: var(--ff-clashDisplay-bold);
  color: var(--cf-neutral-white-100);
  font-size: 20.5vw;
  line-height: 100%;
}
h1 {
  font-family: var(--ff-clashDisplay-regular);
  color: var(--cf-primary-400);
  font-size: 5vw;
  line-height: 100%;
}
h2 {
  font-family: var(--ff-clashDisplay-semibold);
  color: var(--cf-primary-400);
  font-size: 3rem;
  line-height: 110%;
}
h3 {
  font-family: var(--ff-clashDisplay-semibold);
  color: var(--cf-neutral-white-100);
  font-size: 1.5rem;
  line-height: 120%;
}
h4 {
  font-family: var(--ff-clashDisplay-semibold);
  color: var(--cf-neutral-black-900);
  font-size: 3.75rem;
  line-height: 100%;
}
p {
  font: var(--ff-inter-regular);
  color: var(--cf-neutral-black-900);
  font-size: 1rem;
  line-height: 120%;
}

.label-1 {
  font-family: var(--ff-clashDisplay-medium);
  color: var(--cf-neutral-black-900);
  font-size: 1rem;
  line-height: 120%;
}
.label-2 {
  font-family: var(--ff-inter-bold);
  color: var(--cf-neutral-black-900);
  font-size: 1rem;
  line-height: 120%;
}
.label-3 {
  font-family: var(--ff-inter-regular);
  color: var(--cf-neutral-black-900);
  font-size: 0.875rem;
  line-height: 100%;
}
.label-4 {
  font-family: var(--ff-clashDisplay-semibold);
  color: var(--cf-primary-400);
  font-size: 8rem;
  opacity: 0.1;
  line-height: 0%;
  transform: translateY(-52px);
}

button {
  background-color: var(--cf-primary-400);
  font-family: var(--ff-clashDisplay-medium);
  color: var(--cf-neutral-white-100);
  font-size: 1rem;
  line-height: 120%;
  border: none;
  padding: 12px 16px;
  border-radius: 8px;
  cursor: pointer;
  margin: 5px;
  transition: 300ms;
}
button:hover {
  -webkit-box-shadow: 0px 5px 0px 0px #e6ea95;
  -moz-box-shadow: 0px 5px 0px 0px #e6ea95;
  box-shadow: 0px 5px 0px 0px #e6ea95;
  transform: translateY(-5px);
}
button:active {
  background-color: var(--cf-neutral-white-100);
  color: var(--cf-primary-400);
  -webkit-box-shadow: 0px 0px 0px 0px var(--cf-neutral-black-900);
  -moz-box-shadow: 0px 0px 0px 0px var(--cf-neutral-black-900);
  box-shadow: 0px 0px 0px 0px var(--cf-neutral-black-900);
  transform: translateY(0px);
  border: 1px solid var(--cf-primary-400);
  transition: 100ms;
}

/* Regular CSS  */
body,
html {
  background-color: var(--cf-secondary-400);
}

/* nav list styleing  */
ul,
li {
  display: inline;
  list-style: none;
  margin-right: var(--ss-ms-s);
}
a {
  color: var(--cf-neutral-white-100);
  text-decoration: none;
  font-family: var(--ff-inter-regular);
}

nav {
  height: min-content;
  display: flex;
  width: 100%;
  align-items: center;
  justify-content: space-between;
  position: absolute;
  z-index: 4;
  margin-top: -1.5rem;
}
/* nav icon  */
#nav-icon4 {
  display: none;
}
#nav-icon1,
#nav-icon2,
#nav-icon3,
#nav-icon4 {
  width: 60px;
  height: 45px;
  position: relative;
  margin-right: 5%;
  -webkit-transform: rotate(0deg);
  -moz-transform: rotate(0deg);
  -o-transform: rotate(0deg);
  transform: rotate(0deg);
  -webkit-transition: 0.5s ease-in-out;
  -moz-transition: 0.5s ease-in-out;
  -o-transition: 0.5s ease-in-out;
  transition: 0.5s ease-in-out;
  cursor: pointer;
}

#nav-icon1 span,
#nav-icon3 span,
#nav-icon4 span {
  display: block;
  position: absolute;
  height: 6px;
  width: 100%;
  background: var(--cf-neutral-white-100);
  border-radius: 9px;
  opacity: 1;
  left: 0;
  -webkit-transform: rotate(0deg);
  -moz-transform: rotate(0deg);
  -o-transform: rotate(0deg);
  transform: rotate(0deg);
  -webkit-transition: 0.25s ease-in-out;
  -moz-transition: 0.25s ease-in-out;
  -o-transition: 0.25s ease-in-out;
  transition: 0.25s ease-in-out;
}
/* Icon 4 */

#nav-icon4 span:nth-child(1) {
  top: 0px;
  -webkit-transform-origin: left center;
  -moz-transform-origin: left center;
  -o-transform-origin: left center;
  transform-origin: left center;
}

#nav-icon4 span:nth-child(2) {
  top: 18px;
  -webkit-transform-origin: left center;
  -moz-transform-origin: left center;
  -o-transform-origin: left center;
  transform-origin: left center;
}

#nav-icon4 span:nth-child(3) {
  top: 36px;
  -webkit-transform-origin: left center;
  -moz-transform-origin: left center;
  -o-transform-origin: left center;
  transform-origin: left center;
}

#nav-icon4.open span:nth-child(1) {
  -webkit-transform: rotate(45deg);
  -moz-transform: rotate(45deg);
  -o-transform: rotate(45deg);
  transform: rotate(45deg);
  top: -3px;
  left: 8px;
}

#nav-icon4.open span:nth-child(2) {
  width: 0%;
  opacity: 0;
}

#nav-icon4.open span:nth-child(3) {
  -webkit-transform: rotate(-45deg);
  -moz-transform: rotate(-45deg);
  -o-transform: rotate(-45deg);
  transform: rotate(-45deg);
  top: 39px;
  left: 8px;
}

/* nav icon ends */
.background-blur {
  position: absolute;
  z-index: 3;
  height: 15rem;
  width: 100%;
  /* frosted glass BG */
  backdrop-filter: blur(10px);
  -webkit-backdrop-filter: blur(10px);
  background: linear-gradient(
    135deg,
    rgba(255, 255, 255, 0.5),
    rgba(255, 255, 255, 0.1)
  );

  border: 1px solid rgba(255, 255, 255, 0.2);
  -webkit-mask-image: linear-gradient(to bottom, black 10%, transparent 80%);
  mask-image: linear-gradient(to bottom, black 10%, transparent 80%);
}

#png {
  position: absolute;
  z-index: 2;
  width: 100vw;
}
.temp-header .display {
  display: inline-block;
  position: absolute;
  z-index: 1;
  transform: translateY(50%);
  text-align: center;
}
#bg {
  position: relative;
  top: 0;
  width: 100vw;
  background-color: red;
}
.temp-header {
  position: relative;
}
.gradient-transition {
  position: absolute;
  bottom: 0;
  z-index: 4;
  height: 6rem;
  width: 100%;
  background: rgb(240, 238, 232);
  background: -moz-linear-gradient(
    0deg,
    rgba(240, 238, 232, 1) 0%,
    rgba(240, 238, 232, 1) 25%,
    rgba(255, 236, 69, 0) 100%
  );
  background: -webkit-linear-gradient(
    0deg,
    rgba(240, 238, 232, 1) 0%,
    rgba(240, 238, 232, 1) 25%,
    rgba(255, 236, 69, 0) 100%
  );
  background: linear-gradient(
    0deg,
    rgba(240, 238, 232, 1) 0%,
    rgba(240, 238, 232, 1) 25%,
    rgba(255, 236, 69, 0) 100%
  );
  filter: progid:DXImageTransform.Microsoft.gradient(startColorstr="#f0eee8",endColorstr="#ffec45",GradientType=1);
}

/* Header Styling Starts */
header img {
  width: 100%;
  height: 100%;
  object-fit: cover;
}
.slider {
  position: absolute;
  top: 0;
  left: 0;
  width: 100vw;
  height: 100vh;
  overflow: hidden;
}

.slide-active {
  position: absolute;
  width: 100%;
  height: 100%;
}

.slide-next {
  position: absolute;
  width: 100%;
  height: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
}

.slide-next .slide-next-img {
  width: 250px;
  height: 350px;
  clip-path: polygon(50% 50%, 50% 50%, 50% 50%, 50% 50%);
}

.slider-content {
  position: absolute;
  left: 2em;
  bottom: 0em;
  width: 90%;
  height: 175px;
  clip-path: polygon(0 0, 100% 0, 100% 100%, 0% 100%);
  overflow: hidden;
  display: inline-block;
}

.slider-content-active {
  position: absolute;
  top: 0;
  left: 0;
  clip-path: polygon(0 0, 100% 0, 100% 100%, 0% 100%);
}

.slider-content-next {
  position: absolute;
  top: 200px;
  left: 0;
  clip-path: polygon(0 0, 100% 0, 100% 100%, 0% 100%);
}

header h3 {
  text-transform: uppercase;
  font-family: var(--ff-clashDisplay-bold);
  font-size: 150px;
  font-weight: lighter;
  color: #fff;
  z-index: 6;
}

h3 span {
  position: relative;
}

header {
  height: 100vh;
  overflow: hidden;
}
/* Header Styling Ends */
/* TEXT SECTIONS STYLE STARTS  */
.text-section {
  margin-top: 14rem;
  margin-bottom: 15rem;
}
.text-section h1 {
  text-align: center;
}
.text-section h1 span:nth-child(1) {
  font-size: 3.1vw;
  font-weight: var(--ff-clashDisplay-regular);
  display: block;
}

.text-section h1 span:nth-child(2) {
  font-size: 6vw;
  font-weight: var(--ff-clashDisplay-bold);
}
.text-section-pill {
  display: grid;
  place-content: center;
  grid-auto-flow: column;
  gap: 1rem;
}
.text-section-pill img {
  width: 27vw;
  max-height: 150px;
  object-fit: cover;
  border-radius: 2rem;
}
/* TEXT SECTIONS STYLE ENDS  */

/* OUR event SECTION STARTS */

.our-event-card {
  height: 540px;
  width: 350px;

  object-fit: cover;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  padding: 1rem;
  border-radius: 1rem;
  color: var(--cf-neutral-white-100);
  background-position: center;
  overflow: hidden;
  position: relative;
}
.our-event-card::before {
  content: "";
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: rgba(0, 0, 0, 0.2); /* Black overlay with 50% opacity */
  border-radius: inherit; /* Inherit the border-radius of the card */
  z-index: 0; /* Place it below the content */
}

.our-event-card * {
  position: relative;
  z-index: 1; /* Ensure content is above the overlay */
}

.our-event-card .date {
  display: inline;
  width: max-content;
  font-family: var(--ff-clashDisplay-medium);
  font-size: 1rem;
  padding: 10px 16px;
  border-radius: 30px;
  background-color: hsla(0, 0%, 100%, 0.2);
}
.our-event-card .location {
  font-family: var(--ff-clashDisplay-semibold);
  font-size: 1.5rem;
}
.our-event-card .description {
  font-family: var(--ff-clashDisplay-medium);
}

.our-event-card button {
  background-color: var(--cf-neutral-white-100);
  color: var(--cf-primary-400);
  font-family: var(--ff-clashDisplay-medium);
  font-size: 1rem;
  width: 100%;
  display: flex;
  justify-content: space-between;
  border-radius: 3rem;
  margin-left: -4px;
}
.our-event-card button:hover {
  box-shadow: none;
  transform: none;
  outline: 2px solid var(--cf-primary-400);
  transition: 200ms;
  scale: 1.015;
}
.swiper-wrapper .swiper-slide:nth-child(1) .our-event-card {
  background-image: url("../Asset/our-work-card-1.jpg");
}
.swiper-wrapper .swiper-slide:nth-child(2) .our-event-card {
  background-image: url("../Asset/our-work-card-2.jpg");
}
.swiper-wrapper .swiper-slide:nth-child(3) .our-event-card {
  background-image: url("../Asset/our-work-card-3.jpg");
}
.swiper-wrapper .swiper-slide:nth-child(4) .our-event-card {
  background-image: url("../Asset/our-work-card-4.jpg");
}
/* OUR EVENT SECTION ENDS */
/* OUR SERVICE SECTION STARTS */
.service {
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  padding: 4rem;
  border-bottom: 1px solid var(--cf-neutral-gray-400);
  cursor: pointer;
}
.service p {
  max-width: 80ch;
  margin: 1rem 0rem;
  color: var(--cf-neutral-white-100);
  font-family: var(--ff-inter-regular);
  display: none;
}
.service div {
  vertical-align: top;
}
.service div div {
  display: inline-block;
}
.service span {
  font-family: var(--ff-clashDisplay-semibold);
  font-size: 2rem;
  color: var(--cf-primary-400);
  margin-right: var(--ss-ms-r);
}
.service-img {
  display: none;
}
.service button {
  background-color: var(--cf-neutral-white-100);
  color: var(--cf-neutral-black-900);
  display: flex;
  align-items: center;
  gap: 0.5rem;
  justify-content: space-between;
  width: max-content;
}
.service button img {
  background-color: var(--cf-neutral-black-900);
  padding: 10px;
  border-radius: 40%;
}
/* OUR SERVICE SECTION ENDS */
/* Animation */
/* text animation  */
.text {
  text-shadow: 0 1.1em 0 currentcolor;
  display: inline-block;
  overflow: hidden;
}
/* Responsive settings  */
@media (min-width: 1100px) {
  .service-img {
    display: block;
  }
  .service p {
    display: block;
    width: 60ch;
  }
  .service {
    background: linear-gradient(
      180deg,
      #717342 0%,
      #717342 43.5%,
      #959855 100%
    );
    padding: 2rem 4rem;
    border-radius: 1rem;
    overflow: hidden;
  }
  .service h4 {
    color: var(--cf-neutral-white-100);
  }
  .service span {
    color: var(--cf-neutral-white-100);
  }
}
@media (max-width: 1200px) {
  header h3 {
    font-size: 100px;
  }
  .slider-content {
    height: 120px;
  }
}
@media (max-width: 834px) {
  :root {
    /* size */
    /* basic  */
    --ss-global-container: 0% 2%;
    /* margin  */
    --ss-ms-xl: var(--ss-ms-xl-t);
    --ss-ms-l: var(--ss-ms-l-t);
  }
  header h3 {
    font-size: 80px;
  }
  .slider-content {
    height: 100px;
  }
  h2 {
    font-size: 3rem;
  }

  .label-4 {
    font-size: 6rem;
    transform: translateY(-42px);
    margin-bottom: var(--ss-ms-l);
  }
  /* nav menu  */
  /* Hidden by default */
  .nav-menu {
    position: fixed;
    top: -100%;
    left: 0;
    height: 100vh;
    width: 100%;
    border-radius: 0 0 16px 16px;
    transition: top 0.7s ease-in-out;
    z-index: 10;

    display: grid;
    place-content: center;
    background-color: #d4d973;
    border-radius: 0px 0px 16px 16px;
  }

  .nav-active {
    top: 0;
  }

  .nav-menu ul li {
    display: block;
    text-align: center;
    font-size: 4rem;
  }
  .nav-menu ul li a {
    font-family: var(--ff-clashDisplay-medium);
  }
  .nav-menu ul {
    margin-bottom: 3rem;
  }
  #nav-icon4 {
    display: block;
    z-index: 11;
  }
}

@media (max-width: 430px) {
  :root {
    /* size */
    /* margin  */
    --ss-ms-xl: var(--ss-ms-xl-p);
    --ss-ms-l: var(--ss-ms-l-p);
    --ss-ms-r: var(--ss-ms-r-p);
    /* padding */
    --ss-ps-l: var(--ss-ps-l-p);
  }
  header h3 {
    font-size: 40px;
  }
  .slider-content {
    height: 80px;
    left: 0.5em;
    width: 95vw;
    overflow: hidden;
  }
  h2 {
    font-size: 2rem;
  }
  h3 {
    font-size: 1.25rem;
  }
  h4 {
    font-size: 1.5rem;
  }
  p {
    font-size: 0.875rem;
  }
  .label-1 {
    font-size: 0.875rem;
  }
  .label-3 {
    font-size: 0.75rem;
  }
  .label-4 {
    font-size: 3rem;
    transform: translateY(-23px);
  }
  #main-logo {
    margin-left: -2rem;
  }
  #nav-icon4 {
    margin-right: 2%;
  }

  #nav-icon4,
  #main-logo {
    scale: 0.8;
  }
  .text-section h1 span:nth-child(1) {
    font-size: 4.2vw;
  }
  .text-section h1 span:nth-child(2) {
    font-size: 8.2vw;
  }
  .text-section-pill img {
    width: 36vw;
    max-height: 30px;
  }
  .text-section-pill {
    gap: 0.3rem;
  }
}
